import React from 'react';
import {Link} from 'react-router-dom';

import './NavBar.css';

function NavBar() {
    return (
        <header class="top">
            <ul>
                <li class="inline"><Link to="/administrator" style={{
                    textDecoration: 'none'}}>Logout</Link></li>
                <li class="inline"><Link to="/administrator/front" style={{
                    textDecoration: 'none'}}>Front Page</Link></li>
                <li class="inline"><Link to="/administrator/ad" style={{
                    textDecoration: 'none'}}>Advertisement</Link></li>
                <li class="inline"><Link to="/administrator/user" style={{
                    textDecoration: 'none'}}>Users</Link></li>
            </ul>
        </header>
    )
}

export default NavBar;
